import React from 'react'

class ExpensesList extends React.Component{
    render(){
        return(
            <div>
            {this.props.name.map(item=><h1>{item}</h1>)}
            {this.props.name.map(item=>{
                <>
                    <h1>{item[0]}</h1>
                    <h1>{item[1]}</h1>
                </>
            })}
            </div>
        )
    }
}

export default ExpensesList
